const data = [
    {
        question: 'Nilai dari sin 90 derajat adalah?',
        answers: ['0', '-1', '1', '-1'],
        correct: 3
    },

    {
        question: 'Presiden Republik Indonesia ke-6 adalah?',
        answers: ['SBY', 'Megawati', 'Gus Dur', 'Jokowi'],
        correct: 1
    },    
    {
        question: 'Panitia Sembilan berjumlahkan berapa anggota?',
        answers: ['9', '18', '27', '36'],
        correct: 1
    },    
    {
        question: 'Nilai dari -1x5x0?',
        answers: ['class', 'style', 'font', 'styles'],
        correct: 2
    },
    {
        question: 'Which is the correct CSS syntax?',
        answers: ['{body:color=black;}', '{body;color:black;}', 'body:color=black;', 'body {color: black;}'],
        correct: 4
    },
    {
        question: 'How do you insert a comment in a CSS file?',
        answers: ['\' this is a comment', '/* this is a comment */', '// this is a comment', '// this is a comment //'],
        correct: 2
    },
    {
        question: 'Which property is used to change the background color?',
        answers: ['color', 'bgcolor', 'background-color', 'bgColor'],
        correct: 3
    },
    {
        question: 'How do you add a background color for all <h1> elements?',
        answers: ['all.h1 {background-color:#FFFFFF;}', 'h1.setAll {background-color:#FFFFFF;}', 'h1.all {background-color:#FFFFFF;}', 'h1 {background-color:#FFFFFF;}'],
        correct: 4
    }
]

export default data
